import Header from '../src/components/molecules/Header/header'
import Icon from '../src/components/atoms/Icon/icon'

const Index = () => {
  return (
    <>
    <Header
      sample='aaa'
      icon = {
        <Icon
          src='../public/icon.png'
          alt='test'
        />
      }
    />
    index page
    </>
  )
}

export default Index;
